import React from 'react';
import headBannerBackground from '../../Asset/Images/head_banner_background.png'
import './HeadBanner.scss';

function HeadBanner() {
  return (
    <div className="head-banner" style={{background: `url(${headBannerBackground})`}}>
      {/* <img src={headBannerBackground} alt="" className='image-background' /> */}
      <div>
        <h1>The Joke Bible</h1>
        <p>Daily Laughs for you and yours</p>
        <div>
          <input type="text" name="" value="" placeholder='How can we make you laugh today ?' />
          <div>
            <img />
          </div>
        </div>
      </div>
    </div>
  );
}

export default HeadBanner;
